var freq, amp, loopTime, t, wiggle1, wiggle2;
freq = 1;
amp = 1.5;
loopTime = thisComp.duration;
t = $bm_mod(time, loopTime);
wiggle1 = wiggle(freq, amp, 1, 1, t);
wiggle2 = wiggle(freq, amp, 1, 1, $bm_sub(t, loopTime));
$bm_rt = linear(t, 0, loopTime, wiggle1, wiggle2);

